import React, { Component } from 'react';

export default class Api extends Component {
    constructor() {
        const url = 'https://randomuser.me/api/?results=10';
    }

    async getData() {
        fetch(url)
            .then(data => data.json())
            .then(res => console.log(res))
            .catch(error => console.log(error));
    }

    render() {
        return <div></div>;
    }
}
